import React from 'react';
import Header from './components/header';
import './App.css';



function App() {
  return (
    <div class="grid-container">
  <div class="footer"></div>
  <div class="header"><Header /></div>
  <div class="leftnav"></div>
  <div class="rightnav"></div>
  <div class="body"></div>
</div>

  );
}

export default App;
